import React from 'react';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { selectColletionItem } from '../../redux/shop/shop.selectors';
import './collection.styles.scss';

const CollectionPage = ({selectCollection}) => {
    console.log(selectCollection);
    return(
    <div className="collection-page">
        <h1>collection Page</h1>
    </div>
)};

const mapStateToProps = (state, ownProp) => createStructuredSelector({
    selectCollection: selectColletionItem(ownProp.match.params.collectionId)(state)
})

export default connect(mapStateToProps)(CollectionPage);
